import React from 'react';
import './GalleryPage.css';

const images = [
  '/gallery/1.jpg',
  '/gallery/2.jpg',
  '/gallery/3.jpg',
  '/gallery/4.jpg',
  '/gallery/5.jpg',
  '/gallery/6.jpg',
  '/gallery/7.jpg',
  '/gallery/11.jpg',
];

const GalleryPage = () => (
  <div className="gallery-page">
    <h2>Hotel Gallery</h2>
    <div className="gallery-grid">
      {images.map((src, idx) => (
        <img key={idx} src={src} alt={`Gallery ${idx + 1}`} className="gallery-img" />
      ))}
    </div>
  </div>
);

export default GalleryPage;
